/** 
 * If applying  {@code predicate} to {@code selector} would always return a constant, returns that constant.Otherwise, returns null. This method would have been private, except it's also used by {@link org.apache.druid.query.filter.vector.SingleValueStringVectorValueMatcher}.
 * @param selector          string selector
 * @param hasMultipleValues whether the selector *might* have multiple values
 * @param predicate         predicate to apply
 */
@Nullable public static Boolean toBooleanIfPossible(final DimensionDictionarySelector selector,final boolean hasMultipleValues,final Predicate<String> predicate){
  if (selector.getValueCardinality() == 0) {
    return predicate.apply(null);
  }
 else   if (!hasMultipleValues && selector.getValueCardinality() == 1 && selector.nameLookupPossibleInAdvance()) {
    return predicate.apply(selector.lookupName(0));
  }
 else {
    return null;
  }
}

